import React from 'react';
import { Map, GoogleApiWrapper } from 'google-maps-react';
import './style.css';

class MapBox extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div>
        <Map
          google={this.props.google}
          zoom={8}
          style={mapStyles}
          initialCenter={{ lat: 47.444, lng: -122.176}}
        />  

      </div>
      );
  }
}

export default MapBox;
